message:
O tempo era curto e todos sabiam disso, mas não pararam o país para salvá-lo, apenas pararam pra ver jogo de futebol. O plano era simples desde o começo:

- lotar os QG’s AOS MILHÕES e não alguns milhares apenas finais de semana e alguns feriados, como o filho do presidente falou no início das manifestações;
- EXIGIR e não pedir intervenção militar JÁ, mas mirabolaram uma tal de “intervenção militar com Bolsonaro no poder”;
- greve geral, empresários e caminhoneiros pararem o país, mas a grande maioria destes primeiros estavam mais preocupados em lucrar com o fim de ano e copa do mundo.

Bolsonaro estava fazendo a parte dele, decreto atrás de decreto, porém como ele mesmo reforçou inúmeras vezes, o poder estava conosco…

🇧🇷🚩🗣 — Interventor indicado por Lula é Ricardo Garcia Cappelli e filiado ao Partido Comunista do Brasil é ex-Secretário Executivo do atual Ministro da Justiça, Flávio Dino

Em relatórios internos, percebe-se o desgosto de alguns integrantes do exército brasileiro e uma busca rápida para não acatar ordens de Cappelli.
